import React from 'react';
import ReactDOM from 'react-dom/client';

import './index.css';
import App from './App';
import AuthContextProvider from './components/store/auth-context';

const root = ReactDOM.createRoot(document.getElementById('root'));
<AuthContextProvider>
{root.render(<App />)}
</AuthContextProvider>
